func TestCrawlMatchDetail_Success(t *testing.T) {
	assert := assert.New(t)
	server := httptest.NewServer(http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
		_, err := w.Write([]byte(htmlDoc))
		assert.Nil(err)
	}))
	defer server.Close()

	searchUrl := fmt.Sprintf("%s/", server.URL)

	matchDetail, err := CrawlMatchDetail(searchUrl, xPathMatchDetail)

	assert.Nil(err)
	
	assert.Equal(matchDetail.MatchDetailTitle.Club1.Name, "Arsenal")
	assert.Equal(matchDetail.MatchDetailTitle.Club2.Name, "Chelsea")
	assert.Equal(matchDetail.MatchDetailTitle.MatchScore, "3 : 1")
}